import React from "react";
import styled from "styled-components";
const HomeAccents = () => {
    return (
        <React.Fragment>
            <h1>Accent</h1>
        </React.Fragment>
    );
};
const Component = styled.div`
    position: absolute;
    top: 0;
    left: 0;
    width: 100%;
    height: 100%;
    background-color: tomato;
    h1 {
        right: 0;
    }
`;

const Square = styled.div`
    height: 138px;
    width: 138px;
`;
export default HomeAccents;
